	add("circulation", "{\"term\":\"circulation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027circulacioun\u0027, from Latin \u0027circulatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of moving in a circle, or in a course which brings the moving body to the place where its motion began\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of passing from place to place or person to person; free diffusion; transmission\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Currency; circulating coin; notes, bills, etc., current for coin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The extent to which anything circulates or is circulated; the measure of diffusion; as, the circulation of a newspaper\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The movement of the blood in the blood-vascular system, by which it is brought into close relations with almost every living elementary constituent. Also the movement of the sap in the vessels and tissues of plants\", \"priority\":5}]}, \"synonyms\":{}}");

