	add("circumlocution", "{\"term\":\"circumlocution\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|circumlocūtiō||the act of speaking around; circumlocution, periphrasis}}. Surface analysis {{prefix|circum|locution|t1\u003daround|t2\u003dtalk|lang\u003den}}; see these for related terms. Probably a calque of Ancient greek (to 1453) \u0027περίφρασις\u0027 (periphrasis)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A roundabout or indirect way of speaking; the use of more words than necessary to express an idea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A roundabout expression\", \"priority\":2}]}, \"synonyms\":{}}");

