	add("circumvallation", "{\"term\":\"circumvallation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027circumvallate\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rampart or other defensive entrenchment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1761\u0027\u0027, Laurence Sterne, \u0027The Life \u0026amp; Opinions of Tristram Shandy, Gentleman\u0027, vol. 3, Penguin 2003, p. 201\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"and in a word, would intrench and fortify them round with as many \u0027\u0027circumvallations\u0027\u0027 and breast-works, as my uncle \u0027Toby\u0027 would a citadel\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, Walter Scott, \u0027Ivanhoe\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Saxon architect had exhausted his art in rendering the main keep defensible, and there was no other \u0027\u0027circumvallation\u0027\u0027 than a rude barrier of palisades\", \"priority\":5}]}, \"synonyms\":{}}");

